-- ----------------------------
-- Table structure for clients
-- ----------------------------
DROP TABLE IF EXISTS clients;
CREATE TABLE clients (
  objid serial,
  first_name varchar(25),
  last_name varchar(25),
  dob date,
  age varchar(10),
  swim_ability int2,
  parent_name varchar(65),
  parent_id integer REFERENCES clients (objid),
  parent integer,
  student integer,
  filemaker integer,
  checked_paper_file integer,
  has_paper_file integer,
  from_labels integer,
  email varchar(80),
  verified integer,
  notes varchar(400),
  date_updated date,
  update_notes varchar(300),
  PRIMARY KEY (objid)
);

CREATE UNIQUE INDEX idx_fullname on clients (last_name, first_name);
COMMENT ON COLUMN clients.verified IS '1=client verified';

